import React from 'react';

const DoctorList = ({ doctors }) => {
  return (
    <div className="p-4">
      <h3 className="text-xl font-bold mb-4 text-white">Doctors Available</h3>
      <ul className="space-y-4">
        {doctors.map((doctor, index) => (
          <li key={index} className="bg-custombg p-4 rounded-lg text-white">
            <h4 className="font-bold text-lg">{doctor.name}</h4>
            <p>Specialty: {doctor.speciality}</p>
            <p>Charges: {doctor.charges}</p>
            <p>Timing: {doctor.timing}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DoctorList;
